// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract ADRegistration {
   // Event to emit when a user is registered as a AD.
   event ADRegistered(address ADAddress);

   // Mapping to keep track of registered ADs.
   mapping(address => bool) public registeredAD;

   // Function to register the sender as a AD, allowing multiple registrations.
   function registerAsAD() public {
       // Setting the sender as a registered AD each time this function is called.
       registeredAD[msg.sender] = true;
       // Emitting the registration event directly here for each registration
       emit ADRegistered(msg.sender);
   }

   // This function might not be necessary if events are emitted immediately upon state change as shown above.
   // However, it is retained here in case there's a specific reason to trigger the event separately.
   function emitRegistrationEvent() public {
       require(registeredAD[msg.sender], "Sender is not registered as a AD.");
       emit ADRegistered(msg.sender);
   }
}

